// src/components/Profile.js
import React from 'react';

const Profile = () => {
    return (
        <div>
            <h1>User Profile</h1>
            <p>Name: Nanakwaku Boakye-Akyeampong</p>
            <p>Email: nba@gmail.com</p>
            <p>Dietary Restrictions: None</p>
            <p>Allergies: None</p>
        </div>
    );
};

export default Profile;
